  "entities" : {
    "user_mentions" : [ ],
    "media" : [ ],
    "hashtags" : [ ],
    "urls" : [ ]
  },
  "geo" : { },
  "id_str" : "361414792466010113",
  "text" : "\"It was the last thing that was leftover from the Armory days that needed done. The question is now, which side to donate to? Day or night?\"",
